import React from 'react';
import '../Profile/Profile.css';

const UserComponent = (oneUser) => {
    return (
        <div className={'user-box'}>
            <div className={'user-box-avatar'}>
                <img src={oneUser.avatarSrc} className={'avatar'}/>
            </div>

            <div className={'user-box-information'}>
                <div className="name">
                    {oneUser.firstName} {oneUser.secondName}
                </div>
                <div className="birthday">
                    День рождения: {oneUser.birthday}
                </div>
                <div className="city">

                </div>
            </div>
        </div>
    );
}

export default UserComponent;
